import React, { Component } from 'react';

class Header extends Component {
  //state = {  } 
  render() { 
    return (
      <nav id="menu">
        <ul>
          <li>
            Home
          </li>
          <li>
            About
          </li>
          <li>
            Portfolio
          </li>
          <li>
            Contact me
          </li>
        </ul>
      </nav>
    );
  }
}
 
export default Header;
